import './App.css'
import Header from './Header'
import { useState, useEffect } from 'react'

function Home() {
  return (
    <>
      <Header />
      <h2 className='p-8'><em>Welcome</em></h2 >
      <p>My name is Noah. I'm a programmer, game developer, and student currently pursuing a degree in Computer Science.</p>
    </>
  )
}

export default Home
